const ThasadithRegular = `@font-face { font-family: 'Thasadith'; font-style: normal; font-weight: 400; src: local('Thasadith Regular'), local('Thasadith-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const ThasadithItalic = `@font-face { font-family: 'Thasadith'; font-style: italic; font-weight: 400; src: local('Thasadith Italic'), local('Thasadith-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Thasadith700 = `@font-face { font-family: 'Thasadith'; font-style: normal; font-weight: 700; src: local('Thasadith Bold'), local('Thasadith-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Thasadith700italic = `@font-face { font-family: 'Thasadith'; font-style: italic; font-weight: 700; src: local('Thasadith Bold Italic'), local('Thasadith-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
